import React from 'react';
import './Lugu.scss';

const Lugu: React.FC<any> = ({ looPilt }) => {
    return (
        <div style={{width: '500px'}}>
           <img src={looPilt} alt="pildike"
           />
        </div>
    )
}

export default Lugu;
